import React from 'react';
import { useRouter } from "next/router";

const Producto = () => {

    //Routing para obtener el id actual 
    const router = useRouter();
    const { query: { id } } = router;

    return ( 
        <div>
            <h1>Dede [id].js</h1>
        </div>
     );
}
 
export default Producto;
